import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import SearchTab from './components/SearchTab';
import CountriesList from './components/CountriesList';
import DropdownMenu from './components/DropdownMenu';
import CountriesProvider from './context/CountriesContext';
import CountryDetails from './components/CountryDetails'; // Create this component
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <CountriesProvider>
          <div>
            <DropdownMenu />
            <SearchTab />
            <Routes>
              <Route path="/" element={<CountriesList />} /> {/* Home page */}
              <Route path="/country/:name" element={<CountryDetails />} /> {/* Details page */}
            </Routes>
          </div>
        </CountriesProvider>
      </div>
    </Router>
  );
}

export default App;
